message: "KoSembol olarak sizler için bir çok clan sembollerini ücretsiz şekilde sunuyoruz.\r\nBir çok şeffaf clan sembolleri, knight online clan symbol ve daha \r\nbinlerce içerik sizler için paylaşıldı ve paylaşılmaya devam edicek.\r\n\r\n\r\nÜcret karşılığında bir çok web site bu hizmeti sağlarken biz tamemen ücretsiz ve \r\nen yeni en kalileti 2021 clan simgeleri yapıyoruz.\r\nEl emeği göz nuru bu symboller siz değerli oyuncular için bir marka olucaktır.\r\nSizlerle bir ömür boyu aile ortamında olacağımızdan hiç şüphemiz yok."
